	('Cina', 'Cd4hY0cQFRF', '2025-01-16 21:08:19.418195+00', '8mCiTC8d1Bt', false, '{"response":"<div>\n    <h2>Pește la cuptor cu broccoli și cartofi dulci</h2>\n    \n    <h3>Pregătire</h3>\n    <ol>\n        <li>Preîncălzește cuptorul la 180°C.</li>\n        <li>Spală bine broccoli sub apă rece.</li>\n        <li>Taie broccoli în buchețele mici.</li>\n        <li>Curăță cartofii dulci de coajă.</li>\n        <li>Taie cartofii dulci în cuburi.</li>\n        <li>Spală peștele sub apă rece și usucă-l cu un prosop de hârtie.</li>\n    </ol>\n\n    <h3>Gătire</h3>\n    <ol>\n        <li>Într-o tavă, așază peștele.</li>\n        <li>Presară sare și piper pe pește.</li>\n        <li>Pune buchețelele de broccoli și cuburile de cartofi dulci în jurul peștelui.</li>\n        <li>Stropește totul cu ulei de măsline.</li>\n        <li>Introdu tava în cuptor și gătește timp de 25 de minute.</li>\n        <li>Verifică dacă peștele este gătit. Ar trebui să fie opac și să se desfacă ușor cu o furculiță.</li>\n        <li>Servește cald.</li>\n    </ol>\n</div>"}'),
