	('Mic dejun', 'AV3IVAVsY04', '2025-01-22 20:01:18.76573+00', 'PalzNaSkSoB', false, '{"response":"<div>\n    <h2>Ouă cu avocado pe pâine integrală</h2>\n    <h3>Pregătire</h3>\n    <ol>\n        <li>Spală bine avocado.</li>\n        <li>Taie avocado în jumătate și scoate sâmburele.</li>\n        <li>Folosește o lingură pentru a scoate pulpa din avocado.</li>\n        <li>Într-un bol, pasează pulpa de avocado cu o furculiță.</li>\n        <li>Adaugă sare și piper după gust.</li>\n        <li>Topește o felie de pâine integrală în prăjitor.</li>\n        <li>Repetă procesul cu a doua felie de pâine integrală.</li>\n    </ol>\n    <h3>Gătire</h3>\n    <ol>\n        <li>Într-o tigaie, adaugă 1 lingură de ulei de măsline.</li>\n        <li>Încălzește tigaia la foc mediu timp de 2 minute.</li>\n        <li>Crăcănește cele 3 ouă în tigaie.</li>\n        <li>Gătește ouăle timp de 3-4 minute până când albușul este complet gătit.</li>\n        <li>Între timp, așază piureul de avocado pe feliile de pâine prăjită.</li>\n        <li>După ce ouăle sunt gata, așază-le deasupra avocado-ului.</li>\n        <li>Servește imediat.</li>\n    </ol>\n</div>"}'),
